import { useDispatch, useSelector } from "react-redux";
import { useNavigate, useParams } from "react-router-dom";
import { useEffect } from "react";
import { handleAddQuestionAnswer } from "../actions/questions";
import { setAuthedUser } from "../actions/authedUser";
import NotFound from './404page';

const PollAnswer = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const { id } = useParams();

  const authedUser = useSelector((state) => state.authedUser);
  const users = useSelector((state) => state.users);
  const questions = useSelector((state) => state.questions);

  const question = questions[id];
  const author = question ? users[question.author] : null;

  useEffect(() => {
    if (!question) {
      dispatch(setAuthedUser(null));
      navigate('/login');
    }
  }, [question, dispatch, navigate]);

  if (!question) return <NotFound />;

  const { optionOne, optionTwo } = question;
  const hasVotedOptionOne = optionOne.votes.includes(authedUser);
  const hasVotedOptionTwo = optionTwo.votes.includes(authedUser);
  const hasVoted = hasVotedOptionOne || hasVotedOptionTwo;

  const optionOneVotes = optionOne.votes.length;
  const optionTwoVotes = optionTwo.votes.length;
  const totalVotes = optionOneVotes + optionTwoVotes;

  const optionOnePercent = Math.round((optionOneVotes / totalVotes) * 100) || 0;
  const optionTwoPercent = Math.round((optionTwoVotes / totalVotes) * 100) || 0;

  const handleVote = (option) => {
    dispatch(handleAddQuestionAnswer(id, option));
  };

  return (
    <div className="center">
      <h1>Poll by {author.name}</h1>
      <img src={author.avatarURL} alt={`Avatar of ${author.name}`} className="avatar" />

      <div>
        {!hasVoted ? (
          <VotingOptions
            question={question}
            onVoteOptionOne={() => handleVote("optionOne")}
            onVoteOptionTwo={() => handleVote("optionTwo")}
          />
        ) : (
          <ResultsDisplay
            optionOneText={optionOne.text}
            optionTwoText={optionTwo.text}
            optionOnePercent={optionOnePercent}
            optionTwoPercent={optionTwoPercent}
          />
        )}
      </div>
    </div>
  );
};

const VotingOptions = ({ question, onVoteOptionOne, onVoteOptionTwo }) => (
  <div>
    <h1>Would You Rather</h1>
    <div>
      <h3>{question.optionOne.text}</h3>
      <button onClick={onVoteOptionOne}>Vote</button>
    </div>
    <div>
      <h3>{question.optionTwo.text}</h3>
      <button onClick={onVoteOptionTwo}>Vote</button>
    </div>
  </div>
);

const ResultsDisplay = ({ optionOneText, optionTwoText, optionOnePercent, optionTwoPercent }) => (
  <div>
    <h1>Your Vote</h1>
    <ProgressBar label={optionOneText} percent={optionOnePercent} />
    <ProgressBar label={optionTwoText} percent={optionTwoPercent} />
  </div>
);

const ProgressBar = ({ label, percent }) => (
  <div className="progress-bar">
    <span>{label}</span>
    <div className="progress-bar-completed" style={{ width: `${percent}%` }}>
      <span className="progress-bar-label">Votes: {percent}%</span>
    </div>
  </div>
);

export default PollAnswer;
